> This mean MLflow client will use the value provided by --default-artifact-root as default `artifact_path`.

`--default-artifact-root` represents the **_root_** artifact directory. The artifact destination is expressed as `<default_artifact_root>/<experiment_id>/<run_id>/artifacts/<artifact_path>`

